css:
.github-RecentCommits {
  max-height: 113px;
  overflow-x: hidden;
  overflow-y: auto;
  border-top: 1px solid #2a2f38;
}
.github-RecentCommits-list {
  margin: 0;
  padding: 8px 0;
  list-style: none;
}
.github-RecentCommits-message {
  padding: 8px 16px;
  text-align: center;
  color: #41505e;
}
.github-RecentCommit {
  position: relative;
  display: flex;
  align-items: center;
  padding: 0 16px;
  line-height: 32px;
}
.github-RecentCommit-authors {
  position: absolute;
  display: flex;
}
.github-RecentCommit-avatar {
  position: relative;
  margin-right: -13px;
  width: 16px;
  height: 16px;
  border-radius: 0px;
  color: transparent;
  background-color: #242931;
  box-shadow: 1px 0 #181d23;
  overflow: hidden;
  transition: margin 0.12s cubic-bezier(0.5, 0.1, 0, 1);
}
.github-RecentCommit-avatar:nth-child(1) {
  z-index: 3;
}
.github-RecentCommit-avatar:nth-child(2) {
  z-index: 2;
  opacity: .7;
}
.github-RecentCommit-avatar:nth-child(3) {
  z-index: 1;
  opacity: .4;
}
.github-RecentCommit-avatar:nth-child(n+4) {
  display: none;
}
.github-RecentCommit-avatar:only-child,
.github-RecentCommit-avatar:last-child {
  box-shadow: none;
}
.github-RecentCommit-authors:hover .github-RecentCommit-avatar {
  display: inline-block;
  margin-right: 1px;
  opacity: 1;
}
.github-RecentCommit-message {
  flex: 1;
  margin: 0 .5em;
  margin-left: 32px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
.github-RecentCommit-undoButton.btn {
  padding: 0 10.66666667px;
  margin-right: 8px;
  height: 20px;
  line-height: 1;
  font-size: .9em;
}
.github-RecentCommit-time {
  color: #41505e;
}
.github-RecentCommit:hover {
  color: #b7c5d3;
  background: #1a2026;
}
.github-RecentCommit.is-selected {
  color: #b7c5d3;
  background: #2a2f38;
}
.github-RecentCommits:focus .github-RecentCommit.is-selected {
  color: #ffffff;
  background: #374753;
}
@media (min-height: 900px) {
  .github-RecentCommits {
    max-height: 177px;
  }
}
@media (min-height: 1200px) {
  .github-RecentCommits {
    max-height: 337px;
  }
}
